const muiTheme = getMuiTheme({
  appBar: {
    height: 50,
  },
});


export default class Header extends React.Component {
    constructor() {
        super();
        this.state = {
                    search: false,
                    homePage: false,
                    uploadNew: false,
                    profile: true,
            }
    }

    render() {
        return (
            <MuiThemeProvider muiTheme={muiTheme}>
            <AppBar>
                <Toolbar>
                    <img className={"doDanceName"} src={logo_name} alt="Do Dance" />
